import React from 'react';

function App() {
  const style = {
    minHeight:"100px"
  }
  return (
    <div className="container">
      <div className="container bg-primary">
        <h3 className="text-center p-3">Accounts</h3>   
      </div>
      <div className="container">
        <div className="w3-card-2" style={style}>
          <h5 className="se-center">Creadit</h5>
        </div>
        <div className="w3-card-2">
          <h5 className="w3-center">Debit</h5>
        </div>
      </div>     
    </div>
  );
}

export default App;
